from copy import deepcopy
class Solution(object):
    def shortestPalindrome0(self, s):
        """
        :type s: str
        :rtype: str
        """
        def isPalindrome(s):
            """
            :type s: str
            :rtype: bool
            """
            i = 0
            j = len(s) - 1
            while i < j:
                if s[i] != s[j]:
                    return False
                else:
                    i += 1
                    j -= 1
            return True

        if len(s) <= 1:
            return s
        elif len(s) == 2:
            if s[0] == s[1]:
                return s
            else:
                return s[1]+s
        elif isPalindrome(s):
            return s

        mid = (len(s)+1)//2

        for i in range(len(s)-mid-1, -1, -1):
            if s[i] == s[i+1]:
                j = 1
                while i >= j:
                    if s[i-j] != s[i+j]:
                        break
                    else:
                        j += 1
                if i < j:
                    return s[:i+j-1:-1] + s
            elif s[i] == s[i+2]:
                j = 1
                while i >= j:
                    if s[i-j] != s[i+2+j]:
                        break
                    else:
                        j += 1
                if i < j:
                    return s[:i+j+1:-1] + s

        return s[:0:-1] + s

    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        def getTable(s):  # get KMP lookup table
            table = [0] * len(s)
            ptr = 0  # search pointer
            for i in range(1, len(s)):
                if s[i] == s[ptr]:
                    table[i] = table[i-1] + 1
                    ptr += 1
                else:
                    ptr = table[i-1]
                    while ptr > 0 and s[i] != s[ptr]:
                        ptr = table[ptr-1]
                    if s[i] == s[ptr]:
                        ptr += 1
                    table[i] = ptr
            return table

        pattern = s + '#' + s[::-1]  # used as KMP search pattern
        maxMatch = getTable(pattern)[-1]
        return s[:maxMatch-1:-1] + s


